"use strict";$(document).ready(function(){$('form[name="search_booking"]').on("submit",function(b){b.preventDefault();var a=$(this);$.ajax({type:"POST",data:a.serialize()+"&action=search_booking",processData:false,cache:false,dataType:"json",success:function(c){checkFormValidations(a,c,function(){window.location.href=c.path})}})});$('form[name="get_promotional_discount"]').on("submit",function(b){b.preventDefault();var a=$(this);$.ajax({type:"POST",data:a.serialize()+"&action=get_promotional_discount",processData:false,cache:false,dataType:"json",success:function(c){checkFormValidations(a,c,function(){$('[data-modal="success"] main > p').html(c.message);$('[data-modal="success"]').addClass("view");setTimeout(function(){location.reload()},1500)})}})})});